apiVersion: operators.coreos.com/v1alpha1
kind: ClusterServiceVersion
metadata:
  annotations:
    alm-examples: '[]'
    capabilities: Seamless Upgrades
    categories: |
      Cloud Provider,Management,OpenShift Optional,Storage
    certified: "false"
    containerImage: quay.io/kenmoini/openshift-upgrade-accelerator-operator:latest
    description: Get faster upgrades by pre-pulling OpenShift Release images to nodes
      so they are available as soon as scheduling occurs.
    features.operators.openshift.io/cnf: "false"
    features.operators.openshift.io/cni: "false"
    features.operators.openshift.io/csi: "false"
    features.operators.openshift.io/disconnected: "true"
    features.operators.openshift.io/proxy-aware: "true"
    features.operators.openshift.io/tls-profiles: "false"
    operatorframework.io/suggested-namespace: openshift-upgrade-accelerator
    operators.openshift.io/infrastructure-features: '["Disconnected", "Proxy-aware"]'
  labels:
    operatorframework.io/arch.amd64: supported
    operatorframework.io/arch.arm64: supported
    operatorframework.io/arch.ppc64le: supported
    operatorframework.io/arch.s390x: supported
    operatorframework.io/os.linux: supported
    operatorframework.io/os.zos: supported
  name: openshift-upgrade-accelerator-operator.v0.0.0
  namespace: placeholder
spec:
  apiservicedefinitions: {}
  customresourcedefinitions:
    owned:
    - description: UpgradeAccelerator is the Schema for the upgradeaccelerators API.
      displayName: Upgrade Accelerator
      kind: UpgradeAccelerator
      name: upgradeaccelerators.openshift.kemo.dev
      version: v1alpha1
  description: The OpenShift Upgrade Accelerator Operator can reduce the time needed
    for a cluster upgrade by pre-pulling OpenShift Release images to nodes so they
    are available as soon as scheduling occurs.
  displayName: OpenShift Upgrade Accelerator
  icon:
  - base64data: 
    mediatype: image/png
  install:
    spec:
      deployments: null
    strategy: ""
  installModes:
  - supported: false
    type: OwnNamespace
  - supported: false
    type: SingleNamespace
  - supported: false
    type: MultiNamespace
  - supported: true
    type: AllNamespaces
  keywords:
  - openshift
  - upgrade
  - update
  - accelerator
  links:
  - name: Openshift Upgrade Accelerator Operator
    url: https://github.com/kenmoini/openshift-upgrade-accelerator-operator
  maintainers:
  - email: ken@kenmoini.com
    name: Ken Moini
  maturity: alpha
  minKubeVersion: 1.21.0
  provider:
    name: Ken Moini
    url: https://github.com/kenmoini/openshift-upgrade-accelerator-operator
  relatedImages:
  - image: quay.io/kenmoini/openshift-upgrade-accelerator-operator:latest
    name: openshift-upgrade-accelerator-operator
  version: 0.0.0
